import React from 'react';
import { Link } from 'react-router-dom';

function AcademicsPopup() {
  return (
    <div className="custom-popup">
      {/* Column for Programs */}
      <div className="popup-column">
        <h3 className="title-name">Programs</h3>
        <Link className="small-text" to='/undergraduate'>Undergraduate Programs</Link>
        <Link className="small-text" to='/postgraduate'>Postgraduate Programs</Link>
      </div>

      {/* Column for Directorates */}
      <div className="popup-column">
        <h3 className="title-name">Directorates</h3>
        <Link className="small-text" to='/post-graduate-studies'>Directorate of Post Graduate Studies</Link>
        <Link className="small-text" to='/research-innovation'>Office of Research, Innovation and Commercialization</Link>
      </div>

      {/* Column for Additional Resources */}
      <div className="popup-column">
        <h3 className="title-name">Additional Resources</h3>
        <Link className="small-text" to='/academic-calendar'>Academic Calendar</Link>
        <Link className="small-text" to='/director-continuing-education'>Directorate of Continuing Education</Link>
      </div>
    </div>
  );
}

export default AcademicsPopup;
